import { CSSProperties, useState } from "react";
import styles from '../Component/HomeHeader.module.css'
import type { MenuProps } from 'antd';
import { Button, Menu } from 'antd';
import {
    AppstoreOutlined,
    ContainerOutlined,
    DesktopOutlined,
    LogoutOutlined,
    MailOutlined,
    MenuFoldOutlined,
    MenuUnfoldOutlined,

    PieChartOutlined,
  } from '@ant-design/icons';
import { log } from "console";

function HomeHeader({collapsed, setCollapsed}:{collapsed:boolean, setCollapsed:any}){
    const toggleCollapsed = () => {
        setCollapsed(!collapsed);
        console.log("collapsed=====", collapsed);
      };
     return (
        <>
        <div className={styles.headerBox}>
          <Button type="text" onClick={toggleCollapsed} className={styles.menuButton}>
            {collapsed ? <MenuUnfoldOutlined style={{color:'white', fontSize:20}}/> : <MenuFoldOutlined style={{color:'white', fontSize:20}}/>}
          </Button>
          <label className={styles.aeLogo}>AE Identification</label>
          {/* 还需要登录和图标 

            https://ae-identification-dev.s3.cn-north-1.amazon…d9eac23de169d6eacb86cc1f2554799eff95d707cf0b77999
          */}

          <LogoutOutlined className={styles.logOut}/>
          <img src="https://ae-identification-dev.s3.cn-north-1.amazonaws.com.cn/media/profiles/avatars/favicon.ico?X-Amz-Algorithm=AWS4-HMAC-SHA256&X-Amz-Credential=AKIART6FVJ6UDT4EG42J%2F20230703%2Fcn-north-1%2Fs3%2Faws4_request&X-Amz-Date=20230703T013513Z&X-Amz-Expires=3600&X-Amz-SignedHeaders=host&X-Amz-Signature=c430c94a86e94bad9eac23de169d6eacb86cc1f2554799eff95d707cf0b77999" alt="logo"/>
        </div>
        </>

     )
}



export default HomeHeader;
